define({"topics" : [{"title":"General operation","shortdesc":"\n            <p class=\"shortdesc\">Here is a presentation of the Flux environment; the project management, the data       management, the command language, the\n               formulas and mathematical functions.\n            </p>\n         ","href":"UserGuide\/English\/topics\/OutilsGeneraux.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e1391","next":"topicID1-d46e1391",},{"title":"Construction of a Flux project","shortdesc":"\n            <p class=\"shortdesc\">The construction of a Flux project consists of several stages: Geometry → Mesh →       Physics → Resolution → Postprocessing;\n               with the possibility to import a CAD file, a mesh,       materials...\n            </p>\n         ","href":"UserGuide\/English\/topics\/ConstructionDunProjetFlux.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e2010","next":"topicID1-d46e2010",},{"title":"Physical applications","shortdesc":"\n            <p class=\"shortdesc\">Flux allows to model different physical phenomena, and includes various applications       (magnetic, electrical, thermal\n               and thermal coupled).\n            </p>\n         ","href":"UserGuide\/English\/topics\/ApplicationsPhysiques.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e6824","next":"topicID1-d46e6824",},{"title":"Circuit and Kinematic Couplings","shortdesc":"\n            <p class=\"shortdesc\">Flux is coupled to a circuit context allowing to model the sources of the devices.Flux       also allow to model the movement\n               via a kinematic coupling.\n            </p>\n         ","href":"UserGuide\/English\/topics\/Couplages.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e9744","next":"topicID1-d46e9744",},{"title":"Co-simulation between Flux and another software","shortdesc":"\n            <p class=\"shortdesc\">Flux is able to couple with several softwares allowing to model mutliphysics       phenomena.</p>\n         ","href":"UserGuide\/English\/topics\/Co-simulation.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e10620","next":"topicID1-d46e10620",},{"title":"Dedicated couplings","shortdesc":"\n            <p class=\"shortdesc\">Several dedicated couplings are implemented in Flux to, carry out vibro-acoustic       studies, magneto-thermal studies and\n               more.\n            </p>\n         ","href":"UserGuide\/English\/topics\/CouplagesMetier.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e11126","next":"topicID1-d46e11126",},{"title":"3D Overlay","shortdesc":"\n            <p class=\"shortdesc\">Flux has predefined models for rotating machines via Overlays allowing to describe a       geometry, a mesh and a physics\n               adapted to the wished machine.\n            </p>\n         ","href":"UserGuide\/English\/topics\/ContexteMetier3D.htm","attributes": {"data-id":"topicID1",},"menu": {"hasChildren":true,},"tocID":"topicID1-d46e11778","next":"topicID1-d46e11778",},{"title":"Flux API","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"UserGuide\/English\/topics\/FluxAPI.htm","attributes": {"data-id":"sans_titre1",},"menu": {"hasChildren":true,},"tocID":"sans_titre1-d46e11805","next":"sans_titre1-d46e11805",}]});